  const [currentForm, setCurrentForm] = useState('login');

  const toggleForm = (formName) => {
    setCurrentForm(formName);
  }
//   //Affichage (render)

  return (
   <div >{    

    currentForm == "login" ? <Login onFormSwitch1={toggleForm} /> : <Providers onFormSwitch1={toggleForm} />} 
    onFormSwitch={toggleForm}


  </div>);
};

export default App;
